import React, { Component } from 'react'
import axios from 'axios';

class MemberDetail extends Component {
    constructor(props) {
        super(props)
        this.state = {member :{}}
    };
    componentDidMount() {
        axios.get(`http://localhost:8092/familytree/member/${this.props.match.params.id}`)
          .then(response => {
            console.log(response.data);
            this.setState({member:response.data})
          }).catch(error =>{
              console.log(error);
          });
      };
      
      render() {
          return (
              <React.Fragment>
                    <h2>{this.state.member}</h2>
              </React.Fragment>
          );
        }
}

export default MemberDetail;
